How to override a key of an object in an array of objects returned from mongodb?<p>I can't seem to override a key on objects in an array returned from a mongodb query...</p>

<p>I have this array of objects, and I just want to override a key, with an edited value.</p>

<p>Basically what I want to do is that I have a key like <code>obj.location.address</code> which may have a value like <code>wall street 34</code></p>

<p>I want to add a regex to the string so that it becomes <code>wall street</code></p>

<p>I try to map over the array of objs and try to override the key with the value of the result of the value passed through a regex...</p>

<p>But it doesn't work... My new array instead of being an array of objects, becomes just an array of strings with the values of <code>obj.location.address</code> which are just strings of addresses like <code>wall street 34</code>, which is super strange. </p>

<p>My code: </p>

<pre><code>exports.mapUsers = async (req, res) =&gt; {
  const coordinates = [req.query.lng, req.query.lat].map(parseFloat);
  const q = {
    location: {
      $near: {
        $geometry: {
          type: 'Point',
          coordinates
        },
        $maxDistance: 10000 // 10km
      }
    }
  };

  const receivedUsers = await User.find(q).select('name location musicLinks genres photo slug skills').limit(10);

  const users = receivedUsers.map( obj =&gt; obj.location.address = obj.location.address.replace(/[0-9]/g, "").replace(/\s*,\s*/g, ", "))
  console.log(users)
  res.json(users)
};
</code></pre>

