MongoDB Compass Community 1.16.3 $match issue with ObjectId + ISODate<p>I am trying to build an <code>aggregation</code> on <strong>MongoDB Compass Community 1.16.3</strong> and I have a strange issue on the <code>$match</code> stage querying <code>ObjectId</code> and <code>ISODate</code> at the same time.</p>

<h2>The non working <em>$match</em> stage</h2>

<pre><code>{
  user_id: ObjectId("5c9168ec5530c90d0c5cd98a"),
  value: {$gte: 600},
  datetime: { $gte: ISODate("2019-02-01T00:00:00Z"), $lt: ISODate("2019-04-10T23:59:59Z") }
}
</code></pre>

<p>This query does not work at all and Compass return <code>Expected end of input but "}" found.</code>  </p>

<p><a href="https://i.stack.imgur.com/hW8ND.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/hW8ND.png" alt="enter image description here"></a></p>

<h2>But these <em>$match</em> stages work</h2>

<pre><code>{
  user_id: ObjectId("5c9168ec5530c90d0c5cd98a"),
  value: {$gte: 600}
}
</code></pre>

<p>Perfect result!</p>

<pre><code>{
  value: {$gte: 600},
  datetime: { $gte: ISODate("2019-02-01T00:00:00Z"), $lt: ISODate("2019-04-10T23:59:59Z") }
}
</code></pre>

<p>Perfect result!  </p>

<p>It seems that the query does not work if I use <code>ObjectId</code> and <code>ISODate</code> at the same time. So, did I made a mistake somewhere? Or do I have to split it in 2 <code>$match</code> stages? Any thoughts?</p>

<h1>Edited</h1>

<p>If I split the pipeline in 2 <code>$match</code> stages <em>(I removed <code>value</code> in this example)</em>, it works well but I don't know if it is a good practice and if it is efficient!</p>

<pre><code>[{
    $match: {
        user_id: ObjectId("5c9168ec5530c90d0c5cd98a")
    }
}, {
    $match: {
        datetime: {
            $gte: ISODate("2019-02-01T00:00:00Z"),
            $lt: ISODate("2019-04-01T00:00:00Z")
        }
    }
}]
</code></pre>

