How can I extract whole documents based on how they compare with their whole collection?<p>I'm trying to extract the latest available daily measurements from a "sparse" collection that might not have a measurement for every day.  I'm interested in getting the whole original document as output.  The collection contains several series of measurements identified by a unique id.</p>

<p>For example, given the following collection:</p>

<pre><code>{ "date" : "2019-04-10", "id" : 1, "measurement" : 50 }
{ "date" : "2019-04-10", "id" : 2, "measurement" : 1 }
{ "date" : "2019-04-10", "id" : 3, "measurement" : 33 }
{ "date" : "2019-04-11", "id" : 1, "measurement" : 52 }
{ "date" : "2019-04-11", "id" : 3, "measurement" : 3 }
{ "date" : "2019-04-12", "id" : 1, "measurement" : 55 }
{ "date" : "2019-04-12", "id" : 2, "measurement" : 12 }
</code></pre>

<p>The above collection contains measurements for 3 ids.  I'd like to retrieve the latest measurements for each id.</p>

<p>For example, the above collection should yield the following result:</p>

<pre><code>{ "date" : "2019-04-12", "id" : 1, "measurement" : 55 }
{ "date" : "2019-04-12", "id" : 2, "measurement" : 12 }
{ "date" : "2019-04-11", "id" : 3, "measurement" : 3 }
</code></pre>

<p>So far, I'm able to extract the latest date for every ids with this:</p>

<pre><code>db.control_subs.aggregate([ { $group : { _id : "$id", "last_date" : { $max : "$date" } } }, { $sort:{ "_id": 1 }} ])
</code></pre>

<p>But this, unfortunately, strips the actual <code>measurement</code> field from the output.</p>

<p>How could I obtain the desired output with a single MongoDB query?</p>

